gu4(){return"\u062c\u0631\u0628 \u0633\u0631\u0639\u0629 \u0627\u0644\u062a\u0648\u0635\u064a\u0644 \u0627\u0644\u0633\u0631\u064a\u0639 \u0645\u0639 \u0631\u0648\u064a\u0627\u0644 \u0625\u0643\u0633\u0628\u0631\u064a\u0633 \u0644\u0648\u062c\u0633\u062a\u064a\u0643\u0633!"},
