gqN(){return"\u0627\u0644\u0633\u0644\u0627\u0645\u0629 \u0648\u0627\u0644\u0623\u0645\u0627\u0646 \u0647\u0645\u0627 \u0627\u0644\u0623\u0647\u0645 \u0641\u064a \u0627\u0644\u0634\u062d\u0646 \u0627\u0644\u062c\u0648\u064a\u060c \u0648\u0646\u062d\u0646 \u0644\u0627 \u0646\u062a\u0631\u0643 \u0645\u062c\u0627\u0644\u064b\u0627 \u0644\u0644\u062a\u0646\u0627\u0632\u0644. \u0645\u0646 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u0647\u0634\u0629 \u0625\u0644\u0649 \u0627\u0644\u0628\u0636\u0627\u0626\u0639 \u0630\u0627\u062a \u0627\u0644\u0642\u064a\u0645\u0629 \u0627\u0644\u0639\u0627\u0644\u064a\u0629\u060c \u064a\u062a\u0639\u0627\u0645\u0644 \u0645\u0648\u0638\u0641\u0648\u0646\u0627 \u0627\u0644\u0645\u062f\u0631\u0628\u0648\u0646 \u0645\u0639 \u0628\u0636\u0627\u0626\u0639\u0643 \u0628\u0623\u0642\u0635\u0649 \u062f\u0631\u062c\u0627\u062a \u0627\u0644\u0639\u0646\u0627\u064a\u0629."},
